'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendCloseMarketOrderCommand extends SendSingleCommandWithoutResponse {
    closeMarketOrderRequest;
    openPosition;
    clientRate;
    pointSize;
    timeController;
    constructor() {
        super();
        this.commandName = "SendCloseMarketOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createCloseMarketOrderRequestMessage(this.tradingSession, this.closeMarketOrderRequest, this.clientRate, this.pointSize, this.openPosition, this.requestNumberGenerator, stdlib.nowutc(), this.timeController);
    }
}
module.exports = SendCloseMarketOrderCommand
